import React from 'react';
import { Game } from './Game';
import './App.css';
import { SudokuProvider } from './context/SudokuContext';

/**
 * 根组件
 */
export const SudokuGame = () => {
  return (
    <SudokuProvider>
      <Game />
    </SudokuProvider>
  );

}
